CREATE TABLE pentaho_external_data
(
  id bigint NOT NULL,
  amp_org_id bigint NOT NULL,
  value_date date,
  budget_value double precision,
  expenditure_ministry_value double precision,
  currency_code character varying(255),
  CONSTRAINT pentaho_external_data_pkey PRIMARY KEY (id ),
  CONSTRAINT fk99d5abeea0655d08 FOREIGN KEY (amp_org_id)
      REFERENCES amp_organisation (amp_org_id) MATCH SIMPLE
      ON UPDATE NO ACTION ON DELETE NO ACTION
)
WITH (
  OIDS=FALSE
);
ALTER TABLE pentaho_external_data
  OWNER TO postgres;

